commit.message:
Fix 100s retry (#41)

* Fix overly specific check for an API error message

The google API error message for the `RESOURCE_EXHAUSTED`/"100s" problem no
longer contains the string "100s" but instead "100 seconds"

Example of current error message:

```json
gspread.exceptions.APIError: {
  "error": {
    "code": 429,
    "message": "Quota exceeded for quota group 'ReadGroup' and limit 'Read requests per user per 100 seconds' of service 'sheets.googleapis.com' for consumer 'project_number:578503393320'.",
    "status": "RESOURCE_EXHAUSTED",
    "details": [
      {
        "@type": "type.googleapis.com/google.rpc.Help",
        "links": [
          {
            "description": "Google developer console API key",
            "url": "https://console.developers.google.com/project/<...>"
          }
        ]
      }
    ]
  }
}
```

* Docs: change comment text to match change in google API error msg
